import React from "react";
import Element from "./Element";

export default function PeriodicTable() {
  return (
    <div className="periodic-table">
      <Element
        elementName="Hydrogen"
        elementSymbol="H"
        elementMass="1.008"
        elementNumber="1"
      />
    </div>
  );
}
